//Get top down textures
var textureDef;
var textureNames;
var textures = {
  chest: "https://mcbe-essentials.github.io/assets/chest_top.png",
  light_block: "https://upload.wikimedia.org/wikipedia/commons/4/48/BLANK_ICON.png"
};
var texturePrefix = "https://github.com/Mojang/bedrock-samples/raw/main/resource_pack/";
var texturePostfix = ".png";
async function fetchData(){
  textureDef = await fetch('https://raw.githubusercontent.com/Mojang/bedrock-samples/main/resource_pack/blocks.json').then(data => data.json());
  textureNames = await fetch('https://raw.githubusercontent.com/Mojang/bedrock-samples/main/resource_pack/textures/terrain_texture.json').then(data => data.json());
  textureNames = textureNames.texture_data;
  
  getTopTextures();
}

var disallowedBlocks = [
  "air",
  "light_block"
];

function getTopTextures(){
  var textureDefKeys = Object.keys(textureDef);
  for(var i = 0; i < textureDefKeys.length; i++){
    var texName = "";
    if(textureDef[textureDefKeys[i]].textures){
      //Not air
      if(typeof textureDef[textureDefKeys[i]].textures == "string"){
        texName = textureDef[textureDefKeys[i]].textures;
      } else if(textureDef[textureDefKeys[i]].textures.constructor.name == 'Array'){
        texName = textureDef[textureDefKeys[i]].textures[0];
      } else if(textureDef[textureDefKeys[i]].textures.constructor.name == 'Object'){
        texName = textureDef[textureDefKeys[i]].textures.up;
      }
    } else {
      //Is air
      texName = "";
    }
    
    if(texName != ""){
      if(textureNames[texName].textures.constructor == "Array"){
        textures[textureDefKeys[i]] = texturePrefix +textureNames[texName].textures[0] + texturePostfix;
      } else if(textureNames[texName].textures.constructor == "Object"){
        textures[textureDefKeys[i]] = texturePrefix + textureNames[texName].textures.path + texturePostfix;
      } else if(typeof textureNames[texName].textures == "string"){
        textures[textureDefKeys[i]] = texturePrefix + textureNames[texName].textures + texturePostfix;
      }
    }
  }
}

var canvas = document.getElementById("myCanvas").getContext("2d");

var imageQueue = [];
function drawTile(src, x, y){
  if(src != undefined){
    var img = new Image();
    img.onload = function(){
      canvas.drawImage(img, (16 * x) + 0, (16 * y) + 0, 16, 16);
      imageQueue.splice(0, 1);
      if(imageQueue.length > 0){
        drawTile(imageQueue[0].src, imageQueue[0].x, imageQueue[0].y);
      }
    }
    img.src = src;
  }
}

function drawGrid(){
  //Box width
  var bw = document.getElementById("myCanvas").width;
  // Box height
  var bh = document.getElementById("myCanvas").height;
  // Padding
  var p = 0;
  for (var x = 0; x <= bw; x += 16) {
      canvas.moveTo(0.5 + x + p, p);
      canvas.lineTo(0.5 + x + p, bh + p);
  }
  for (var x = 0; x <= bh; x += 16) {
      canvas.moveTo(p, 0.5 + x + p);
      canvas.lineTo(bw + p, 0.5 + x + p);
  }
  canvas.strokeStyle = "black";
  canvas.stroke();
}

fetchData();

function drawStructureTop(sdata){  
  var palette = sdata.value.structure.value.palette.value.default.value.block_palette.value.value;
  var block_indicies = sdata.value.structure.value.block_indices.value.value[0].value;
  var structureSize = sdata.value.size.value.value;
  var nonAirBlocks = [];
  var sortedBlocks = {};
  var topBlocks = [];
  
  document.getElementById("myCanvas").width = structureSize[0] * 16;
  document.getElementById("myCanvas").height = structureSize[2] * 16;
  drawGrid();
  
  //Identify which palette value is air
  var paletteAir = 0;
  for(var i = 0; i < palette.length; i++){
    if(palette[i].name.value == "minecraft:air"){
      paletteAir = i;
    }
  }
  
  //Get non-air blocks
  for(var i = 0; i < block_indicies.length; i++){
    if(!(block_indicies[i] == paletteAir || block_indicies[i] == -1)){
      nonAirBlocks.push(i);
    } 
  }
  
  //topBlocks = nonAirBlocks;
  
  //Get top layer
  var topCoords = [];
  for(var i = 0; i < structureSize[0]; i++){
    for(var a = 0; a < structureSize[2]; a++){
      topCoords.push([i, structureSize[1]-1, a]);
    }
  }
  
  //Fix top layer
  for(var i = 0; i < topCoords.length; i++){
    var blockCoords = topCoords[i];
    
    var ddone = false;
    for(var a = 0; a < structureSize[1]; a++){
      var ccoords = [topCoords[i][0], (structureSize[1]-1 - a), topCoords[i][2]];
      var currentBlock = palette[block_indicies[getStructureBlockIndex(structureSize, ccoords)]];
      var currentBlockName = "air";
      if(currentBlock){
        currentBlockName = currentBlock.name.value.replaceAll("minecraft:", "");
      }
      if(!disallowedBlocks.includes(currentBlockName)){
        if(!ddone){
          blockCoords[1] = blockCoords[1] - a;
          ddone = true;
        } else {
          //console.log(currentBlockName, "done");
        }
      } else {
        //console.log(currentBlockName);
      }
    }
  }
  
  //Draw non-air blocks
  for(var i = 0; i < topCoords.length; i++){
    var coords = topCoords[i];
    var blockIndex = getStructureBlockIndex(structureSize, topCoords[i]);
    var tex;
    if(palette[block_indicies[getStructureBlockIndex(structureSize, topCoords[i])]] && (textures[palette[block_indicies[getStructureBlockIndex(structureSize, topCoords[i])]].name.value.replaceAll("minecraft:", "")] != undefined) ){
      tex = textures[palette[block_indicies[getStructureBlockIndex(structureSize, topCoords[i])]].name.value.replaceAll("minecraft:", "")];
      /*METHOD 2 imageQueue.push(
        {
          src: tex,
          x: coords[0], 
          y: coords[2]
        }
      );*/
      drawTile(tex, coords[0], coords[2]);
    }
  }
  //METHOD 2 drawTile(imageQueue[0].src, imageQueue[0].x, imageQueue[0].y);
  
  return topCoords;
}

function getStructureBlockCoords([distX, distY, distZ], index){
  var x = 0; var y = 0; var z = 0;
  for(var i = 0; i < index; i++){
    z++;
    if(z == distZ){
      z = 0; y++;
      if(y == distY){
        y = 0; x++;
      }
    }
  }
  return [x,y,z];
}

function getStructureBlockIndex([distX, distY, distZ], [x, y, z]){
  return ((distY * distZ) * x) + ((distZ) * y) + z;
}

